import React from "react";
import '../App.css';
import $ from 'jquery';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
import DeleteIcon from '@material-ui/icons/Delete';
import CloudUploadIcon from '@material-ui/icons/CloudUpload';
import KeyboardVoiceIcon from '@material-ui/icons/KeyboardVoice';
import Icon from '@material-ui/core/Icon';
import SaveIcon from '@material-ui/icons/Save';

const useStyles = makeStyles((theme) => ({
  button: {
    margin: theme.spacing(1),
  },
}));

export default function Contact(){

    const classes = useStyles();

    return(
        <div>
            <div className="container">
                <div className="left-contact">
                    <div className="contacthead">
                        <h2 className="contactheadH2">Contact for more information about the event</h2>
                    </div>
                    
                    <div className="contactText">
                        <span>077 8829 607 (Pasindu Bandara)</span><br/>
                        <span>071 0891 055 (Geethmaka Dissanayake)</span><br/>
                        <span>infosliitmcc@gmail.com</span><br/>
                    </div>
                    <hr className="contactHr"/>
                </div>
                <img className="watermark-mozilla" src="https://res.cloudinary.com/fitness-glory/image/upload/v1639550570/Mozilla_Logo_ezid2w.png"/>
            </div>
           <Button
        variant="contained"
        color="secondary"
        className={classes.button}
        startIcon={<DeleteIcon />}
      >
        Delete
      </Button>
        </div>
    )
}
